property.value:
local drums = { [0] = "BitDrum", [1] = "SplDrum", [2] = "NavDrum", [3] = "TacDataDrum", [4] = "DLDrum", [5] = "TgtDataDrum" }
function onReceiveOSC(msg) local val = msg[2][1].value
for k, v in pairs(drums) do local visible = k == val local drumPage = self.parent:findByName(v, false) if (drumPage) then drumPage.properties.visible = visible end end end
